INSERT INTO `post` (`post_id`, `parent_id`, `category_id`, `post_type`, `date_create`, `date_publish`, `date_modify`, `author`, `image`, `slug`, `title`, `content`, `description`, `kecamatan`, `keyword`, `others`, `status`, `sort`) VALUES
(2, 0, 39, 'map', '2018-09-07 10:34:42', '2021-04-02 00:00:00', '2021-04-02 21:41:37', 'admin', '20180910142313_taman-nasional-way-kambas.jpg', 'taman-nasional-way-kambas', 'Taman Nasional Way Kambas', NULL, '', 'Labuhan Ratu', NULL, '{\"latitude\":\"-5.106266714228267\",\"longitude\":\"105.66196383519775\",\"description\":\"<p>Lokasi secara administratif objek wisata ini adalah terletak di Kecamatan Labuhan Ratu Kabupaten Lampung Timur. Objek wisata ini berjarak 103 Km dari kota Bandar lampung dan 20 Km dari kota Sukadana. Sedangkan untuk letak astronomisnya terletak pada titik koordinat yaitu 05\\u00b007\'02\\\" LS dan 105\\u00b046\'26\\\" BT.Sumatera, khususnya di wilayah Sumatera bagian Selatan. Berdasarkan fungsinya, gajah-gajah di TNWK terbagi menjadi Gajah Tangkat, Gajah Attraksi, Gajah Kerja, Gajah Penyelamat Satwa, Gajah Patroli, dan Gajah Pembantu Pengendali Kebakaran Hutan. Pilihan aktivitas yang dapat dinikmati oleh para wisatawan adalah seperti Jungle Tracking, Safari Night, Atraksi Gajah dalam ruangan, Gajah tunggang, naik kereta gajah, atraksi gajah berenang, joget gajah, gajah bermain bola, dan gajah berlatih. Jungle Tracking dan Safari Night harus memesan terlebih dahulu (Booking).Pusat Konservasi Gajah Way Kambas. Merupakan suaka alam dataran rendah dengan luas lebih kurang 126.000 hektar, dapat dicapai 2 jam berkendaraan dari kota Bandar Lampung melintasi daerah perkebunan Bergen dan Situs Purbakala Pugung Raharjo, perkebunan lada, perkampungan asli Lampung Desa Wana serta persinggahan Way Curup atau bisa juga melewati Kota Metro yang sebelumnya dapat singgah di Kawasan Agro Wisata BBI Pekalongan.\\u00a0<\\/p><p><img src=\\\"data:image\\/png;base64,iVBORw0KGgoAAAANSUhEUgAAAjAAAAHzCAIAAACxB7C\\/AAAAAXNSR0IArs4c6QAAAARnQU1BAACxjwv8YQUAAAAJcEhZcwAADsMAAA7DAcdvqGQAAE1aSURBVHhe7b3NeTO7rq0747khOJIdgVI4zfOs1ukqgB2HOjuBmYOD2RcgQBL8LUpFUSV6vM9cXigSBFksEMOS\\/Vn\\/\\/C8AAABwASBIAAAALgEECQAAwCWAIAEAALgEECQAAACXAIIEAADgEkCQAAAAXAII0gd43P4p+Pn5uT1+1WEuv\\/cfna