lor: rgb(0, 0, 0); font-family: \\\"Open Sans\\\", sans-serif; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\\\">a.Zonasi Taman Nasional Way Kambas\\u00a0<\\/p><p><br><\\/p><p>1.Zona Inti (Core Zone), bagian taman nasional yang mempunyai kondisi alam baik biota atau fisiknya masih asli dan tidak atau belum diganggu oleh manusia yang mutlak dilindungi, berfungsi untuk perlindungan keterwakilan keanekaragaman hayati yang asli dan khas.\\u00a0<\\/p><p>Zona inti TNWK yang terletak di wilayah Way Kanan dan sekitarnya terdiri dari tipe ekosistem hutan hujan dataran rendah dan ekosistem rawa. Pedamaran dan sekitarnya terdapat tipe ekosistem hutan pantai dan ekosistem mangrove. Wilayah Pasir Panjang, Tanjung Bohong, Way Bunut, Kikuk, Tanjung Sekopong terdiri dari tipe ekosistem rawa dan ekosistem pantai. Wako \\u2013 Pelampung Merah \\u2013 Way Seputih terdiri dari tipe ekosistem rawa, mangrove. Wilayah Tanjung Tangis, Way Nibung, Hulu Rasau sampai dengan Parmin terdiri dari tipe ekosistem rawa dan hutan hujan dataran rendah. Zona inti merupakan tempat hidup satwa dan flora utama terdiri dari :\\u00a0<\\/p><p>a)golongan mamalia yaitu badak Sumatera (Dicerhorinus sumatranus), gajah Sumatera (Elephas maximus), harimau Sumatera (Panthera tigris sumatrae), tapir (Tapirus indicus), beruang madu (Helarctos malayanus), kucing emas (Felis temminckii), anjing hutan (Cuon alpinus).\\u00a0<\\/p><p>b)Golongan Primata yaitu Siamang (Hylobatus syndactyllus), owa (Hylobatus agilis).\\u00a0<\\/p><p>c)Golongan aves yaitu mentok rimba (Cairina scutulata), Rangkong (Buceritidae sp), Raja Udang (Halcyon funebris, Alcedo eoryzona).\\u00a0<\\/p><p>d)Tumbuhan yang terdapat di zona inti yaitu :\\u00a0 kelompok meranti (Shorea sp), mentru (Schima walichii), rengas (Gluta rengas), gelam (melaleuca leucadendron), gaharu (Aquilaria sp), simpur (Dilenia sp), pulai (Alstonia scholaris), kelompok nephentes\\/kantung semar, kelompok anggrek-anggrekan seperti anggrek tebu (Gramathophilum sp) dan talas (Amarphophalus sp)<\\/p><p>2.Zona Rimba (No Take Zone), adalah bagian taman nasional yang karena letak, kondisi dan potensinya mampu mendukung kepentingan pelestarian pada zona inti dan zona pemanfaatan. Zona rimba di TNWK memiliki potensi dan keterwakilan sumberdaya penting yaitu hutan hujan dataran rendah, ekosistem rawa, pantai, dan mangrove, yang harus dilindungi untuk menjaga keutuhan dan kelestarian keterwakilan ekosistem asli dan fungsi ekologisnya serta mendukung zona inti.\\u00a0<\\/p><p>3.Zona Khusus Konservasi adalah bagian taman nasional yang karena letak, kondisi dan potensinya digunakan untuk\\u00a0 kepentingan konservasi khusus satwa langka (badak Sumatera). Zona khusus konservasi TNWK merupakan ekosistem hutan hujan dataran rendah yang secara keseluruhan merupakan hutan alam sekunder. Lokasi ini merupakan habitat badak Sumatera, harimau Sumatera dan gajah Sumatera. Potensi flora yang terdapat di zona ini yaitu hutan meranti, simpur, puspa, jenis tumbuhan rawa, pulai.<\\/p><p>4.Zona Pemanfaatan Intensif (Intensif use zone), adalah bagian taman nasional yang letak, kondisi dan potensi alamnya yang terutama dimanfaatkan untuk kepentingan pariwisata alam dan jasa lingkungan lainnya. Zona pemanfaatan di TNWK memiliki potensi dan keterwakilan sumberdaya penting yang merupakan daya tarik wisata alam dan pemanfaatan jasa lingkungan lainnya seperti pengelolaan satwa liar, keterwakilan ekosistem hutan hujan dataran rendah, ekosistem rawa, ekosistem hutan pantai dan eksosistem mangrove. untuk menjaga keutuhan dan kelestarian keterwakilan ekosistem asli dan fungsi ekologisnya serta mendukung zona inti.\\u00a0<\\/p><p>5.Zona Pemanfaatan khusus (Tempat Pemakaman Umum\\/TPU) adalah bagian taman nasional yang karena secara turun temurun telah dipergunakan untuk tempat pemakaman sebelum taman nasional berdiri.\\u00a0<\\/p><p>6.Zona khusus (TPU) Rantau Jaya Udik II merupakan tempat pemakaman umum.<\\/p><p><br><\\/p>\",\"youtube\":\"nStDQRz_MO8\",\"address\":\"Jl. Raya Lintas Pantai Timur Sumatera, Raja Basa Lama, Labuhan Ratu, Kabupaten Lampung Timur, Lampung 34375, Indonesia\"}', 'publish', 1);
