(6, 0, 39, 'map', '2018-09-10 07:39:07', '2021-04-02 00:00:00', '2021-04-02 19:02:46', 'admin', '20180917151224_taman-wisata-beringin-indah.png', 'taman-wisata-beringin-indah', 'Taman Wisata Beringin Indah', NULL, '', 'Sukadana', NULL, '{\"latitude\":\"-5.06871869836678\",\"longitude\":\"105.51547834912117\",\"description\":\"Lokasi secara administratif objek wisata ini adalah terletak di Desa Negara Nabung Kecamatan Sukadana Kabupaten Lampung Timur. Objek Wisata ini berjarak 82 Km dari kota Bandarlampung dan ber-jarak 6 Km dari kota Sukadana. Secara astronomis Dam Bereingin Indah terletak pada 05\\u00b004\'06\\\" LS dan 105\\u00b030\'50\\\" BT.\\r\\nWisatawan yang berkunjung relatif sedikit. Wisatawan yang datang hanya didominasi oleh wisatawan yang domisilinya dekat dengan daerah ini. Media informasi dan promosi perlu dikembangkan untuk menunjang pengembangan objek\\r\\nMenurut Pengurus Danau Beringin Indah bahwa upaya yang dikembangkan dan objek wisata ini adalah berbagai usaha untuk memberikan sadar wisata pada Pokdarwis (Kelompok Sadar Wisata) dengan sasaran pemuda desa setempat. Harapannya adalah untuk menciptakan suasana yang kondusif serta anti pentingnya Danau Beringin Indah sebagai salah satu objek wisata.\",\"address\":\"Desa Negara Nabung, Sukadana, Terbanggi Marga, Sukadana, Kabupaten Lampung Timur, Lampung 34194, Indonesia\"}', 'publish', 1),
