(38, 0, 39, 'map', '2018-09-17 08:01:49', '2021-04-02 00:00:00', '2021-04-27 14:34:59', 'admin', '20180917150149_pantai-wisata-karang-mas.png', 'pantai-wisata-karang-mas', 'Pantai Wisata Karang Mas', NULL, '', 'Labuhan Maringgai', NULL, '{\"latitude\":\"-5.371726\",\"longitude\":\"-5.371726\",\"description\":\"Lokasi secara administratif objek wisata ini adalah terletak di Desa Muara Gading Mas Kecamatan Labuhan Maringgai Kabupaten Lampung Timur. Objek Wisata ini berjarak 135 Km dan kota Bandarlampung jika di tempuh melewati kota Sukadana dan berjarak 40 Km dari kota Sukadana. Secara astronomis pantai Muara Gading Mas terletak pada 05\\u00b022\'15\\\" LS dan 105\\u00b049\'7\\\" BT.\\r\\nDaya tank obiek wisata ini adalah keindahan pantai yang masih asri. Selain itu kehidupan nelayan yang ada disekitar objek ini juga sangat menarik. Ekosistem hutan mangrove juga dapat dijadikan sehagai salah satu kajian wisata edukatif yang dapat menarik wisatawan dari segi dunia pendidikan. Pantai Kerang Mas sangat berpotensi karena dapat dikembangkan lebih maksimal.\\r\\nFasilitas yang ada cukup memadai. Wisatawan banyak yang berkunjung di objek wisata Pantai Muara Gading Mas pada bulan Desember sebanyak 5.073 wisatawan domestik dan bulan Agustus sebanyak 1800 wisatawan Domestik. Hal ini terjadi karena wisatawan yang berkunjung lebih didominasi karena libur sekolah sebagai sarana wisata kelurga.\\r\\nUpaya yang dilakukan untuk mengembangkan objek wisata ini adalah dengan mengembangkan Pokdarwis (Kelompok Sadar Wisata). Selain itu upaya untuk menjaga kelestarian serta kebersihan lingkungan pantai juga digalakkan oleh pemerintah desa.\",\"youtube\":null,\"address\":\"Jalan Raya, Muara Gading MAS, Labuhan Maringgai, Kabupaten Lampung Timur, Lampung, Indonesia\"}', 'publish', 1),
