(48, 0, 40, 'map', '2018-09-17 09:49:03', '2021-04-02 00:00:00', '2021-04-02 18:59:48', 'admin', '20180917164903_jagung-maize.jpg', 'jagung-maize', 'Jagung (Maize)', NULL, '', 'Bandar Sribhawono', NULL, '{\"latitude\":\"-5.280598607371355\",\"longitude\":\"105.67443678417976\",\"description\":\"Kabupaten Lampung Timur merupakan salah satu sentra produksi komoditas tanaman pangan khususnya padi dan jagung dengan potensi lahan sawah seluas 63.044 ha dan lahan kering (tegal\\/kebun) seluas 91.204 ha.\\r\\n\\r\\nKomoditas jagung produksi tahun 2017 mencapai 701.098  ton dengan luas panen 126.552 ha, mengalami peningkatan yang cukup signifikan yaitu sebesar 227.481 ton atau 48,03 % dibanding tahun 2016 sebesar 473.617 ton.\\r\\n\\r\\nPeningkatan IP melalui perbaikan infrastruktur terutama jaringan irigasi tersier dan irigasi rawa serta pompanisasi dengan pemanfaatan sumber-sumber air yang ada.\",\"address\":\"Jl. Margo Marsudi, Bandar Agung, Bandar Sribawono, Kabupaten Lampung Timur, Lampung 34384, Indonesia\"}', 'publish', 1),
(49, 0, 40, 'map', '2018-09-17 09:59:02', '2021-04-02 00:00:00', '2021-04-02 18:59:23', 'admin', '20180917165902_padi-paddy.png', 'padi-paddy', 'Padi (Paddy)', NULL, '', 'Jabung', NULL, '{\"latitude\":\"-5.412010608899017\",\"longitude\":\"105.70751185148663\",\"description\":\"Kabupaten Lampung Timur merupakan salah satu sentra produksi komoditas tanaman pangan khususnya padi dan jagung dengan potensi lahan sawah seluas 63.044 ha dan lahan kering (tegal\\/kebun) seluas 91.204 ha.\\r\\n\\r\\nProduksi padi  Kabupaten Lampung Timur memberikan kontribusi cukup besar terhadap produksi Provinsi Lampung dan menempati posisi terbesar kedua setelah Kabupaten Lampung Tengah.  Produksi padi tahun 2017 mencapai  700.275 ton meningkat sebesar 54.362 ton atau 8,42 % dibanding tahun 2016 yaitu sebesar 645.913 ton. Begitu juga dengan luas panen meningkat dari 123.441 ha tahun 2016 menjadi 128.652 ha tahun 2017.\\r\\n\\r\\nTahun 2018 sasaran tanam padi Kabupaten Lampung Timur seluas 133.232 ha dan sampai dengan saat ini realisasi tanam mencapai 94.052 ha.\\r\\n\\r\\nPeningkatan IP melalui perbaikan infrastruktur terutama jaringan irigasi tersier dan irigasi rawa serta pompanisasi dengan pemanfaatan sumber-sumber air yang ada.\\r\\nPeningkatan produktivitas melalui perbaikan aplikasi teknologi dengan GPPTT (Gerakan Pengelolaan Penerapan Tanaman Terpadu) berbasis padi nonhibrida dan padi hibrida.\\r\\n\",\"address\":\"Unnamed Road, Pematang Tahalo, Jabung, Kabupaten Lampung Timur, Lampung 34384, Indonesia\"}', 'publish', 1),
