(54, 0, 39, 'map', '2018-09-18 04:46:38', '2021-04-02 00:00:00', '2021-04-02 18:41:41', 'admin', '20180918114638_kawasan-agrowisata-balai-benih-induk-holtikultura.png', 'kawasan-agrowisata-balai-benih-induk-holtikultura', 'Kawasan Agrowisata Balai Benih Induk Holtikultura', NULL, '', 'Pekalongan', NULL, '{\"latitude\":\"-5.070818243364231\",\"longitude\":\"105.36077781825225\",\"description\":\"Terdapat di Pekalongan. BBIH diresmikan Menteri Pertanian sebagai kawasan agrowisata pada 2 Januari 2006. Lokasi BBIH berjarak 60 km dari Bandar Lampung, 7 km dari Kota Metro. Disana dapat dijumpai tanaman obat dan buah, misalnya: durian, mangga, rambutan, sawo, lengkeng, duku, jambu air, cempedak, dan lain-lain. Total area 114 Ha, baru 64 Ha termanfaatkan. Komposisi, 50 % untuk lahan penangkaran dan 50 % untuk lahan produksi.\\r\\nLokasi secara administratif objek wisata ini adalah terletak di Kecamatan Pekalongan Kabupaten Lampung Timur. Objek Wisata ini berjarak 65 Km dan kota Bandarlampung dan berjarak 20 Km dari kota Sukadana. Secara astronomis BBIH Pekalongan terletak pada 05\\u00b004\'14\\\" LS dan 105\\u00b021\'38\\\" BT.\\r\\nDaya tarik objek yang ditawarkan di objek wisata Agrowisata BBIH Holtikultura berupa beraneka ragam jenis tanaman buah yang ditanam di komplek agrowisata BBI Holtikultura Pekalongan. Tanaman buah yang ditanam mayoritas adalah tanaman buah musiman dan wisatawan dapat menikmati buah-buahan yang ada tersebut.\\r\\n\\r\\nWisatawan yang berkunjung di objek wisata BBIH Pekalongan di dominasi oleh Pelajar umum, Kelompok Tani, serta Pelajar atau Mahasiswa PKL. Persebaran jumlahnya merata karena BBIH Pekalongan, melayani setiap waktu dan kegiatan-kegiatan yang berlangsung, seperti percontohan untuk kelompok tani dan pelayanan pelajar\\/mahasiswa PKL, selalu tersedia setiap bulannya.\",\"address\":\"Jl. Pertanian, Pekalongan, Kec. Pekalongan, Kabupaten Lampung Timur, Lampung 34391, Indonesia\"}', 'publish', 1),
