(59, 0, 39, 'map', '2018-09-18 04:58:05', '2021-04-02 00:00:00', '2021-04-03 09:44:25', 'admin', '20180918115805_danau-way-jepara.png', 'danau-way-jepara', 'Danau Way Jepara', NULL, '', '', NULL, '{\"latitude\":\"-5.201946\",\"longitude\":\"105.669337\",\"description\":\"Lokasi secara administratif objek wisata ini adalah terletak di Desa Labuhan Ratu danau Kecamatan Way Jepara Kabupaten Lampung Timur. Objek Wisata ini berjarak 115 Km dari kota Bandar lampung dan berjarak 30 Km dari kota Sukadana. Secara astronomis Danau Way Jepara terletak pada 05\\u00b012\'09\\\" LS dan 105\\u00b040\'10\\\" BT.\\r\\nDaya tank objek wisata ini adalah keindahan panorama alam yang ada. Keadaan danau yang asri dan aspek lingkungan yang masih terjaga sangat berpotensi bagi para wisatawan untuk datang berkunjung di objek wisata.\",\"youtube\":\"u9UUTFiY-GY\",\"address\":\"Jalan Simpang Danau, Sumberjo, Way Jepara, Kabupaten Lampung Timur, Lampung 34396, Indonesia\"}', 'publish', 1),
