(70, 0, 42, 'map', '2021-04-03 03:06:41', '2021-04-03 00:00:00', '2021-04-03 10:06:41', 'admin', '20210403100641_budidaya-ikan-nila-kecamatan-jabung.jpg', 'budidaya-ikan-nila-kecamatan-jabung', 'Budidaya Ikan Nila (Kecamatan Jabung)', NULL, '', 'Jabung', NULL, '{\"latitude\":\"-5.507506066266894 \",\"longitude\":\"105.7039216318465\",\"description\":\"<p>Budaya Ikan Nila dilakukan di lahan berupa Kolam Air Tenang, Kolam Air Deras, Sawah, Keramba, Jaring Apung dan Kolam Terpal. Produksi mencapao 1.500 ton pertahun. Salah jeni komoditas yang telah berkembang teknologi budidayanya. Dari segi teknis relatif mudah dibudidayakan dibandingkan ikan air tawar yang lain. Mempunyai potensi lahan\\/areal budidaya yang cukup besar.<\\/p><p>Peluang investasi:<\\/p><p>1. Budidaya Ikan Nila.<\\/p><p>2. Industri Pengolahan Ikan Nila.<\\/p><p>3. Usaha Pemasaran Ikan NIla.<\\/p><p>4. Industri Pakan Ikan.<\\/p>\",\"youtube\":null,\"address\":\"\"}', 'publish', 1),
(71, 0, 42, 'map', '2021-04-03 03:24:18', '2021-04-03 00:00:00', '2021-04-03 10:25:58', 'admin', '20210403102418_rumput-laut.jpg', 'rumput-laut', 'Rumput Laut', NULL, '', 'Pasir Sakti', NULL, '{\"latitude\":\"-5.546187317278888 \",\"longitude\":\"105.81604180776371\",\"description\":\"<p>Rumput Laut atau alga telah lama menjadi salah satu produk yang banyak dikonsumsi oleh masyarakat dunia. Saat ini, dengan kemajuan ilmu pengetahuan dan teknologi, pemanfaatan rumput laut sudah sangat beragam, baik itu untuk produk pangan maupun non pangan.<\\/p><p>Secara garis besar, produk turunan rumput laut dapat dikelompokkan menjadi 5P, yaitu Pangan, Pakan, Pupuk, Produk Kosmetik, dan Produk Farmasi.<\\/p><p>Terdapat luas wilayah sebesar 48.871 ha di sepanjang garis pantai Kabupaten Lampung Timur yang sangat potensial untuk digunakan sebagai Kawasan pengembangan budidaya rumput laut.<\\/p>\",\"youtube\":null,\"address\":\"Sepanjang Garis Pantai Kabupaten Lampung Timur\"}', 'publish', 1),
(72, 0, 41, 'map', '2021-04-03 03:44:44', '2021-04-03 00:00:00', '2021-04-03 10:45:27', 'admin', '20210403104444_sapi-potong.jpg', 'sapi-potong-kecamatan-raman-utara', 'Sapi Potong (Kecamatan Raman Utara)', NULL, '', 'Raman Utara', NULL, '{\"latitude\":\"-4.97555582884413 \",\"longitude\":\"105.44548577333184\",\"description\":\"<p>Potensi Peternakan Sapi di Kabupaten Lampung Timur adalah sentra produksi daging sapi dengan produksi daging sapi mencapai 2.100 ton (15,8%\\u00a0 dari total produksi daging sapi di Provinsi Lampung).<\\/p><p>Populasi di Kabupaten Lampung Timur sebanyak 143.638 ekor, dan tersebar di seluruh kecamatan, salah satunya Raman Utara dengan populasi tertinggi.<\\/p><p>Sebagai penghasil jagung terbesar di Provinsi Lampung membuat ketersediaan sumber pakan sapi potong menjadi cukup besar sehingga memungkinkan untuk memiliki populasi sapi potong yang tinggi.\\u00a0<\\/p>\",\"youtube\":null,\"address\":\"Kecamatan Raman Utara.\"}', 'publish', 1),
(73, 0, 43, 'map', '2021-04-03 05:16:47', '2021-04-03 00:00:00', '2021-04-03 12:18:32', 'admin', '20210403121647_pengrajinan-batik-kabupaten-lampung-timur.jpg', 'pengrajinan-batik-kabupaten-lampung-timur', 'Pengrajinan batik Kabupaten Lampung Timur', NULL, '', 'Purbolinggo', NULL, '{\"latitude\":\"-5.019811\",\"longitude\":\"105.576210\",\"description\":\"<p>Batik Lampung Timur merupakan kerajinan tangan yang dibuat oleh komunitas disabilitas, bertempat di SLB Negeri Lampung Timur.<\\/p>\",\"youtube\":\"VOetpezBYCM\",\"address\":\"Desa Tambah Dadi, Kec. Probolinggo\"}', 'publish', 1),
